export default {
  name: 'ServerList',
  props: {
    values: {
      type: Array,
      default: function() {
        return []
      }
    },
    mulselect: {
      type: Array,
      default: function() {
        return []
      }
    }
  },
  methods: {
    schange(val) {
      this.$emit('mulselect', val)
    },
    serverEdit(server) {
      this.$emit('edit', server)
    },
    serverDelete(server) {
      this.$confirm(`此操作将删除该${server.cluster_name} 集群记录, 是否继续?`, '删除redis集群', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(() => {
        this.$emit('delete', server.id)
      }).catch(() => {
        this.$message({
          type: 'info',
          message: '已取消删除'
        })
      })
    },
    serverOperation(server) {
      this.$emit('operation', server.id)
    }
  }
}
